import logo from './logo.svg';
import './App.css';
import { ChakraProvider, Tab, TabList, Tabs } from '@chakra-ui/react'

function App() {
  return (
    <ChakraProvider>
      <Tabs>
        <TabList>
          <Tab>STORIA</Tab>
          <Tab>RISTORANTE</Tab>
          <Tab>PIZZA</Tab>
          <Tab>PASTICCERIA</Tab>
          <Tab>COTATTI</Tab>
          <Tab>NEWS</Tab>
          <Tab>ITALIANO</Tab>
          <Tab>INGLESE</Tab>
        </TabList>
      </Tabs>
    </ChakraProvider>
  );
}

export default App;
